    <script>

        window.onload = function () {
            var svgClone = document.querySelector("svg");
            var scale = 1.6; // 缩放SVG,放大用于提高清晰度
            var rect = svgClone.getBoundingClientRect();
            var svgWidth = rect.width;
            var svgHeight = rect.height;
            var canvas = document.createElement('canvas');
            canvas.width = svgWidth * scale;
            canvas.height = svgHeight * scale;;

            // 绘制Canvas
            var ctx = canvas.getContext('2d');
            ctx.scale(scale, scale);

            var data = (new XMLSerializer()).serializeToString(svgClone);
            var DOMURL = window.URL || window.webkitURL || window;
            var img = new Image();
            var svgBlob = new Blob([data], { type: 'image/svg+xml;charset=utf-8' });
            var url = DOMURL.createObjectURL(svgBlob);
            img.onload = function () {
                console.log(img);
                ctx.drawImage(this, 0, 0);
                DOMURL.revokeObjectURL(url);
                // 转换Canvas为PNG图片
                var png = canvas.toDataURL('image/png', {
                    quality: 1,        // 最高质量
                    pixelFormat: 'RGB24', // 兼容性更好
                });
                console.log(png);
            };
            img.src = url;

        }
    </script>
